import React from "react";
import { styled } from "styled-components";

const GNBWrap = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  height: 70px;
  border: 1px solid #000;
`;

const GNB = () => {
  return <nav id="GNB">GNB</nav>;
};

export default GNB;
